import React from "react";
import "./Login.css";
import { accessUrl } from "./spotify";

function Login() {
  return (
    <div className="login">
      <img
        src="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/2a9bee67-1b86-42ba-893f-8a8c5a3e1733/d8wpo2o-c62ef7c1-9ec5-43d6-b328-659d5f4f7866.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..5HM5mrE2AgSxyTWke0BTrIVO_2LOndPDxmggHatYi_I"
        alt=""
      />
      <a href={accessUrl}>LOGIN</a>
    </div>
  );
}

export default Login;
